import './Button.css'

function Button(props) {
    const handleClick = () => {
        this.props.clickHandler(this.props.name);
      };

    return (
      <div className='calc-button'>
        <button onClick={handleClick}>{props.btnName}</button>
      </div>
    );
  }

  export default Button;
